import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  store:{
    marginTop:30,
    height:40,
    width:40,
  },
  buttonContainer:{
    width: 280,
    height: 100,
    background: 'linearGradient(90deg,#9adad6, #98d8d4 6%, #95d5d1 12%, #92d3cf 19%, #8fd0cc 26%, #8bcdc8 34%, #87c9c5 42%, #83c6c2 50%, #7fc3be 58%, #7bbfbb 66%, #77bcb7 74%, #73b9b4 81%, #6fb6b1 88%, #6bb3ae 94%, #68b0ab)',
    borderRadius: 10,
  },
});
